*Calma Patriotas*. Faz parte do jogo o PL pedir anulação. A legenda do presidente tem que endossar a decisão do presidente de não reconhecer a derrota. Estão apenas criando subsídios para justificar a intervenção, o objetivo do relatório das FFAA teve o mesmo objetivo.
Observem outros fatos que as manifestações já geraram:
1. Carla Zambelli, nossa deputada federal, juntamente com o comentarista da JP, Paulo Figueiredo que é neto do Presidente Figueiredo, no dia 14, levaram a denúncia a OEA e foram muito bem recebidos; 
2. As vaias e xingamentos do povo brasileiro em NY contra os ministros é um dos assuntos mais vistos e comentados no mundo, mostrando o desprestígio que a suprema corte tem no Brasil;
3. Os gritos de Lula ladrão em Interlagos correram o mundo, era um evento mundial;
4. Ontem, dia 14 de novembro, o mundo tomou conhecimento de mais um relatório das auditorias  do argentino, mostrando que conseguiu entrar no cofre do TSE e das urnas, revelando voto a voto. Os eleitores de Ciro Gomes e Simone viram que também foram roubados e estão indignados;
5. A jovem Pan voltou a falar bem das manifestações para o mundo;
6. Os índios aderiram ao movimento, chamando atenção das ONGs, entidades internacionais e a corte de direitos humanos na ONU; 
7. Os senadores já cobram uma posição do Pacheco, presidente do senado;
8. A Record está exibindo documentário dos sofrimentos dos países socialistas da América Latina e de Cuba;
9.Nicolas ajuizou no STF denúncias contra as ações do Alexandre de Morais no TSE;
10. Vídeos de inconsistências nas urnas e eleitores reclamando que não conseguiram votar em Bolsonaro viralizaram mundo afora;
11. Os depoimentos dos advogados de Bolsonaro, que antes das eleições pediram o voto impresso com negativa do STF, estão sendo jogados em todas as redes sociais;
12. Os jornais já jogam a culpa do que está acontecendo no congresso, que rejeitou o projeto do voto impresso por pressão do STF;
12+1.. O novo ministro da defesa já mandou o duro discurso de proteção ao povo brasileiro e direito as manifestações, afastando ações da PM dos governadores esquerdistas;
14. Já existem presidentes de países admitindo que na eleição do Brasil houve fraude;
15. As FFAA querem resposta do STE sobre o processo eleitoral, para acessar o código fonte no que, possivelmente, não será atendida, porque revelaria a fraude; isso já é o grande xeque-mate das FFAA no STE;
16. Lula viajando em avião de empresário condenado na lava jato pegou muito mal pra ele;
17. A equipe de transição de Lula, a cada dia, assusta o mundo com suas ações; Lula se revela um baita mentiroso a cada dia;
18. O jantar do ministro Barroso com o advogado de Lula em NY, seguido pelo famoso "perdeu Mané", já colocou mais fubá nesse angu, levantando suspeitas no mundo todo, enfim, daquela boca foi que também saiu a frase: "eleição não se ganha, se toma".
19. Caminhoneiros, empresas e comércios estão a cada dia mais presentes nas  manifestações;
20. Empresários, banqueiros e comerciantes esquerdistas estão sentindo na pele o que acontece com quem defende um  ladrão e corrupto no poder;
21. As manifestações estão dando um exemplo aos povos da América Latina e ao mundo de como deve se comportar um povo diante dos abusos e arbitrariedades comunistas. 
22. O Brasileiro, diante dos quartéis e do sistema corrupto, está mostrando sua resiliência, sua força, seu caráter honesto e sua dignidade. Gritar SOS FFAA é o grito de defesa de nossa liberdade e do nosso poder, como povo e como nação.

